import React from "react";
import corgi from "./assets/corgibutt.jpg";
import capySolo from "./assets/capysolo.jpg";
import smolBois from "./assets/smolbois.jpg";

const Gallery = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <img src={corgi} alt="corgi but shaped plate" max-width="300px"/>
        </div>
        <div className="col">
          <img src={capySolo} alt="Capybara ring dish" />
        </div>
        <div className="col">
          <img src={smolBois} alt="small animal planters" />
        </div>
      </div>
    </div>
  );
};

export default Gallery;
